sintesis:
Participaron, entre otros, la gerenta general de P&G, Gabriela Bardin; el vicepresidente de Ventas de Unilever, Pablo Cotet; el CEO de Mastellone, Carlos Agote; el vicepresidente de Asuntos Corporativos de Quilmes, Gonzalo Fagioli; el director Ejecutivo de Coca Cola, Esteban Agost Carreño; el director comercial de Arcor, Gustavo Bertone; el CEO de Molinos Río de la Plata, Agustín Llanos; el presidente de Molinos Cañuelas, Aldo Navielli; el director de Relaciones Institucionales de Papelera del Plata, Lisandro Vinstky; y la directora de Asuntos Corporativos de Mondelez, Paula Morrone.
Además, estuvieron presentes el director de Georgalos, Gustavo Giménez; el vicepresidente de Danone, Diego Buranello; el CEO de Morixe, Román Malcediño, y el presidente de Cabrales, Martín Cabrales.
Asistieron también el CEO de Coto, Guillermo Calcagno; el presidente de Carrefour, Pablo Lorenzo; el CEO de Changomás, Martín Lemos; el CEO de Día, Agustín Ibero; el presidente de La Anónima, Federico Braun;
